import axios from 'axios'

const initialPersons = 'http://localhost:3001/persons';

const getPersons = () => (
  axios.get('http://localhost:3001/persons').then(response => {
    return response.data;
  })
)

const addPerson = () => (
  axios.post()
)

export default { getPersons, addPerson };
